import { useEffect, useState } from 'react';
import { Row, Col, Card, Button, Form, FormText } from 'react-bootstrap';
import { useForm, Controller } from 'react-hook-form';
import * as yup from 'yup';
import { yupResolver } from '@hookform/resolvers/yup';
import jsPDF from 'jspdf'; // To generate PDF
import url from '../../env';
// hooks
import { usePageTitle } from '../../hooks';
import secureLocalStorage from 'react-secure-storage';
import { useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';
import moment from 'moment';

// Define types
type PaymentData = {
    client_id: string;
    reference_scheme_amount: number;
    ref_payment_mode: string;
    ref_payment_refno: string;
    ref_payment_receivedBy: string;
    ref_payment_receivedDate: string;
};

// Define the type for branch data
type Branch = {
    _id: string;
    branch_name: string;
};

// Define the type for Client data
type client = {
    _id: string;
    client_id: string;
    client_name: string
};
type Staff = {
    _id: string;
    staff_id: string;
    staff_name: string
};

// Validation schema
const schema = yup.object().shape({
    client_id: yup.string().required('Select client'),
    reference_scheme_amount: yup.number().required(' Amount is required').min(1,'Amount Is Greater Then 0'),
    ref_payment_mode: yup.string().required('Payment Mode is required'),
});

const RefSchPaymentForm = () => {
    const StorageuserData:any = secureLocalStorage.getItem('userData');
    const userData:any = JSON.parse(StorageuserData);
    const [branches, setBranches] = useState<Branch[]>([]);
    const [clients, setClients] = useState<client[]>([]);
    const [staff, setStaff] = useState<Staff[]>([]);
    const [clientbranch, setClientBranch] = useState('');
    const [branchErr,setBranchErr] = useState(false);
    const navigate = useNavigate();
    const [clientName,setClientName] = useState('');
    const [client_id,setClient_id] = useState('')
    // const [sipmember_month,setSipmember_month] = useState('')
    var today = new Date();
    var TodayDate = today.toISOString().split('T')[0];
    const { control, handleSubmit, reset,formState: { errors }, setValue } = useForm<PaymentData>({
        resolver: yupResolver(schema),
    });
    var Months = [{value:'January',lable:'January'},
        {value:'February',lable:'February'},
        {value:'March',lable:'March'},
        {value:'April',lable:'April'},
        {value:'May',lable:'May'},
        {value:'June',lable:'June'},
        {value:'July',lable:'July'},
        {value:'August',lable:'August'},
        {value:'September',lable:'September'},
        {value:'October',lable:'October'},
        {value:'November',lable:'November'},
        {value:'December',lable:'December'}
    ]
    
    const generatePDF = (data:any) => {

        
        const doc = new jsPDF({
            orientation: 'landscape', // Set to landscape
            unit: 'mm',
            format: [105, 148], // A6 size in landscape
        });

        // Assuming you've imported the images, use the image variables directly
        const logoImage = 'data:image/png;base64,';
        const backgroundImage = 'data:image/png;base64,';
        // Header
        doc.addImage(logoImage, 'PNG', 8, 5, 25, 15); // Adjust size and position of the logo, less space from top
        doc.setFontSize(15);
        doc.setTextColor(255, 0, 0);
        doc.setFont('helvetica', 'bold');
        doc.text('Cosmohub Solutions Private Limited', 35, 10);
        
        doc.setFontSize(10);
        doc.setTextColor(0, 0, 0);
        doc.setFont('helvetica', 'normal');
        doc.text('A-222, Kasturi Plaza, Manpada Rd, Dombivali(East),Pin: 421202', 35, 17);

        doc.setFontSize(8);
        doc.setTextColor(0, 0, 0);
        doc.setFont('helvetica', 'normal');
        doc.text('( CIN : U96906MH2024PTC430524, GSTIN : )', 35, 22);
        
        // Draw a line after the header with minimal spacing
        doc.line(10, 25, 138, 25); // Adjusted y-coordinates for a straight line with minimal space
        
        // Background image with adjusted size and extra space above
        doc.addImage(backgroundImage, 'PNG', 0, 25, 148, 81, '', 'FAST'); // Slightly increased height
        
        // Body
        doc.setFontSize(9);
        doc.setFont('helvetica', 'bold');
        doc.text('Customer Copy', 10, 30);
        
        // Receipt Details
        // const date = new Date().toLocaleDateString();
        const date =  moment(data.sip_payment_receivedDate).format('DD/MM/YYYY');


        doc.setFontSize(9);
        
        // Receipt No:
        doc.setFont('helvetica', 'bold');
        doc.text('Receipt No:', 10, 39);  // Y-coordinate incremented by 9
        doc.setFont('helvetica', 'normal');
        doc.text(`${data.sippayment_receiptno}`, 30, 39); // Slightly reduced space between label and value
        
        // Date:
        doc.setFont('helvetica', 'bold');
        doc.text('Date:', 108, 39);
        doc.setFont('helvetica', 'normal');
        doc.text(`${date}`, 118, 39);
        
        // Received with thanks from:
        doc.setFont('helvetica', 'bold');
        doc.text('Received with thanks from:', 10, 48);
        doc.setFont('helvetica', 'normal');
        doc.text(`${data.Sip_id}, ${data.sipmember_name}`, 53, 48); // Slightly reduced space between label and value
        
        // Amount (INR):
        doc.setFont('helvetica', 'bold');
        doc.text('Amount (INR):', 10, 57);
        doc.setFont('helvetica', 'normal');
        doc.text(`${data.sip_amount}`, 33, 57);
        
        // Amount in Words:
        doc.setFont('helvetica', 'bold');
        doc.text('Amount in Words:', 10, 66);
        doc.setFont('helvetica', 'normal');
        doc.text(`${convertNumberToWords(data.sip_amount)}`, 40, 66);
        
        // Received By:
        doc.setFont('helvetica', 'bold');
        doc.text('Received By:', 10, 75);
        doc.setFont('helvetica', 'normal');
        doc.text(`${(data.sip_payment_mode === 'UPI'|| data.sip_payment_mode === 'NetBanking')?data.sip_payment_mode:data.sip_payment_receivedBy}`, 33, 75);
        
        // Payment Mode/Transaction ID:
        if (data.sip_payment_mode === 'UPI' || data.sip_payment_mode === 'NetBanking') {
            doc.setFont('helvetica', 'bold');
            doc.text('Transaction ID:', 83, 75); // Right-aligned on the same line
            doc.setFont('helvetica', 'normal');
            doc.text(`${data.sip_payment_refno}`, 108, 75);
        } else if (data.sip_payment_mode === 'Cash') {
            doc.setFont('helvetica', 'bold');
            doc.text('Payment Mode:', 83, 75); 
            doc.setFont('helvetica', 'normal');
            doc.text('Cash (Yes)', 108, 75);
        }
        
        // Space for Signatures
        doc.setFont('helvetica', 'bold');
        doc.text('Depositor Signature', 10, 100);  // Y-coordinate incremented by 9
        doc.text('Authorized Signature', 108, 100);
        
        // Save the PDF
        doc.save('payment_receipt.pdf');
    }        

        const units = ['', 'One', 'Two', 'Three', 'Four', 'Five', 'Six', 'Seven', 'Eight', 'Nine'];
        const teens = ['', 'Eleven', 'Twelve', 'Thirteen', 'Fourteen', 'Fifteen', 'Sixteen', 'Seventeen', 'Eighteen', 'Nineteen'];
        const tens = ['', 'Ten', 'Twenty', 'Thirty', 'Forty', 'Fifty', 'Sixty', 'Seventy', 'Eighty', 'Ninety'];
        const thousands = ['', 'Thousand', 'Million', 'Billion'];

        function convertNumberToWords(amount: number) {
            if (amount === 0) return 'Zero';

            let words = '';
            let i = 0;

            while (amount > 0) {
                let chunk = amount % 1000;
                if (chunk > 0) {
                    words = `${convertChunkToWords(chunk)} ${thousands[i]} ${words}`.trim();
                }
                amount = Math.floor(amount / 1000);
                i++;
            }

            return words.trim();
        }

        function convertChunkToWords(chunk: number) {
            let words = '';

            if (chunk > 99) {
                words += `${units[Math.floor(chunk / 100)]} Hundred `;
                chunk %= 100;
            }

            if (chunk > 10 && chunk < 20) {
                words += `${teens[chunk - 10]} `;
            } else {
                words += `${tens[Math.floor(chunk / 10)]} ${units[chunk % 10]} `;
            }

            return words.trim();
        }

    const onSubmit = async(formData: PaymentData) => {
        console.log('Form data:', formData);

        if(userData.staff_branch == '0' && clientbranch == '')
        {
            setBranchErr(true);
        }
        else
        {
            var dataToPost = {
                client_id: formData.client_id,
                client_name: clientName,
                reference_scheme_amount: formData.reference_scheme_amount,
                ref_payment_mode: formData.ref_payment_mode,
                ref_payment_refno: (formData.ref_payment_refno)?formData.ref_payment_refno:'',
                ref_payment_receivedBy: formData.ref_payment_receivedBy,
                ref_payment_receivedDate: formData.ref_payment_receivedDate,
                branch_id:(userData.staff_branch =='0')?clientbranch:userData.staff_branch
            }

            

            try {
                const bearerToken = secureLocalStorage.getItem('login');
                const response = await fetch(`${url.nodeapipath}/referencesch`, {
                    body: JSON.stringify(dataToPost),
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                        'Access-Control-Allow-Origin':'*',
                        'Authorization': `Bearer ${bearerToken}`
                    },
                    
                });
                const result = await response.json();
                if(response.ok)
                {   
                    
                    console.log('Payment successful:', result);
                    // generatePDF(result.sipPaymentReciept[0]);
                    toast.success(result.message || 'Payment added Successfully.')
                    navigate('/all-refschpayment')
                }
                else
                {
                    toast.error(result.message || 'Failed To add SIP Payment.')
                }
                
            } catch (error) {
                // console.error('Error during Payment:', error);
                toast.error('Error adding payment');
            }
        }
            
        
        
        
    };

    useEffect(()=>{
        const bearerToken = secureLocalStorage.getItem('login');
        const fetchBranches = async () => {
            try {
                const response = await fetch(`${url.nodeapipath}/branch/all/all`,{
                    method:'GET',
                    headers: {
                        'Content-Type':'application/json',
                        'Access-Control-Allow-Origin':'*',
                        'Authorization': `Bearer ${bearerToken}`
                        }
                });
                const data = await response.json();
                // console.log(data);   
                
                if (response.ok) {
                    setBranches(data.branch || []);
                } else {
                    console.error('Error fetching branches:', data);
                }
            } catch (error) {
                console.error('Error during API call:', error);
            }
        };
        fetchBranches();

        // Fetch branches from the backend
        const fetchClients = async () => {
            try {
                const bearerToken = secureLocalStorage.getItem('login');
                const response = await fetch(`${url.nodeapipath}/all/client/${userData.staff_branch}`,{
                    method:'GET',
                    headers: {
                        'Content-Type':'application/json',
                        'Access-Control-Allow-Origin':'*',
                        'Authorization': `Bearer ${bearerToken}`
                        }
                });
                const data = await response.json();

                
                if (response.ok) {
                    setClients(data.client || []);

                } else {
                    console.error('Error fetching branches:', data);
                }
            } catch (error) {
                console.error('Error during API call:', error);
            }
        };

        fetchClients();

        const fetchStaff = async () => {
            try {

                const response = await fetch(`${url.nodeapipath}/all/staff/${userData.staff_branch}`,{
                    method:'GET',
                    headers: {
                        'Content-Type':'application/json',
                        'Access-Control-Allow-Origin':'*',
                        'Authorization': `Bearer ${bearerToken}`
                        }
                });
                const data = await response.json();
                if (response.ok) {
                    setStaff(data.staff || []);

                } else {
                    console.error('Error fetching branches:', data);
                }
            } catch (error) {
                console.error('Error during API call:', error);
            }
        };

        fetchStaff();
    },[])



    const handleClientChange = (e:any)=>{
        var clientname = clients.filter((item)=> item._id == e.target.value)
        
        setClientName(clientname[0].client_name);
    }

    const handleBranchChange = (e:any)=>{
        setClientBranch(e.target.value)
        if(e.target.value == '')
        {
            setBranchErr(true)
        }
        else
        {
            setBranchErr(false)
        }  
    }


    

    return (
        <Card>
            <Card.Body>
                <h4 className="header-title mt-0 mb-1">Reference Scheme Payment</h4>
                <p className="sub-header">Fill in the details to generate a reference scheme payment.</p>
                <form onSubmit={handleSubmit(onSubmit)}>
                    <Row>
                        <Col md={6}>
                            <Form.Group className="mb-2">
                                <Form.Label>Client ID</Form.Label>
                                <Controller
                                    name="client_id"
                                    control={control}
                                    render={({ field }) => (<Form.Select
                                    {...field}
                                    isInvalid={!!errors.client_id}
                                    onChange={(e)=>{field.onChange(e.target.value); handleClientChange(e)}}
                                    >
                                        <option>Select Client</option>
                                        {clients.map((client) => (
                                             <option key={client._id} value={client._id}>
                                                 {`${client.client_id}, ${client.client_name}`}
                                             </option>
                                             ))}
                                    </Form.Select>
                                    )}
                                />
                                <Form.Control.Feedback type="invalid">
                                    {errors.client_id?.message}
                                </Form.Control.Feedback>
                            </Form.Group>
                        </Col>
                        <Col md={6}>
                            <Form.Group className="mb-2">
                                <Form.Label>Client Name</Form.Label>
                                <Form.Control placeholder="Enter Name" value={clientName} disabled={true}/>
                            </Form.Group>
                        </Col>
                    </Row>
                     <Row>
                        <Col md={6}>
                            <Form.Group className="mb-2">
                                <Form.Label>Reference Scheme Amount</Form.Label>
                                <Controller
                                    name="reference_scheme_amount"
                                    control={control}
                                    defaultValue={0}
                                    rules={{
                                        min: { value: 1, message: "Amount must be greater than 0" } // Additional validation rule
                                    }}
                                    render={({ field }) => <Form.Control type="number" {...field} value={field.value || ''} onChange={(e)=>{field.onChange(e.target.value)}} isInvalid={!!errors.reference_scheme_amount} placeholder="Enter Scheme Amount" />}
                                />
                                <Form.Control.Feedback type="invalid">
                                    {errors.reference_scheme_amount?.message}
                                </Form.Control.Feedback>
                            </Form.Group>
                        </Col>
                        <Col md={6}>
                            <Form.Group className="mb-2">
                                <Form.Label>Payment Mode</Form.Label>
                                <Controller
                                    name="ref_payment_mode"
                                    control={control}
                                    render={({ field }) => <Form.Select
                                    {...field}
                                    isInvalid={!!errors.ref_payment_mode}>
                                        <option>Select Payment mode</option>
                                        <option value="Cash">Cash</option>
                                        <option value="UPI">UPI</option>
                                        <option value="Net banking">Net Banking</option>
                                    </Form.Select>}
                                />
                                <Form.Control.Feedback type="invalid">
                                    {errors.ref_payment_mode?.message}
                                </Form.Control.Feedback>
                            </Form.Group>
                        </Col>
                    </Row>
                    <Row>
                        <Col md={6}>
                            <Form.Group className="mb-2">
                                <Form.Label>Payment Ref. No.</Form.Label>
                                <Controller
                                    name="ref_payment_refno"
                                    control={control}
                                    render={({ field }) => <Form.Control {...field} 
                                    onChange={(e)=>{field.onChange(e.target.value)}}
                                    placeholder="Enter Payment Ref. No." />}
                                />
                            </Form.Group>
                        </Col>
                        <Col md={6}>
                            <Form.Group className="mb-2">
                                <Form.Label>Received By</Form.Label>
                                <Controller
                                    name="ref_payment_receivedBy"
                                    control={control}
                                    defaultValue={userData.staff_id}
                                    render={({ field }) => <Form.Select
                                    {...field} onChange={(e)=>{field.onChange(e.target.value)}} disabled={(userData.staff_id == "0")?false:true}
                                    >
                                        <option>Select Staff</option>
                                        <option value="0">Super Admin</option>
                                        {staff.map((staff)=>(
                                            <option value={staff._id}>{staff.staff_name}</option>
                                        ))}
                                    </Form.Select>}
                                />
                            </Form.Group>
                        </Col>
                    </Row>
                   <Row>
                        <Col md={6}>
                            <Form.Group className="mb-2">
                                <Form.Label>Received Date</Form.Label>
                                <Controller
                                    name="ref_payment_receivedDate"
                                    control={control}
                                    defaultValue={TodayDate}
                                    render={({ field }) => <Form.Control type="date" {...field} onChange={(e)=>{field.onChange(e.target.value)}} disabled={true}/>}
                                />
                            </Form.Group>
                        </Col>
                        {(userData.user_role_type == '0') && (
                                <>
                                <Col md={6}>
                                 <Form.Group className="mb-3">
                                 <Form.Label>Branch Name</Form.Label>
                                 <select className={(branchErr)?"form-control is-invalid":"form-control"} id="branch" onChange={(e)=>{handleBranchChange(e)}} >
                                         <option value="">-- Select --</option>
 
                                         {branches.map((branch) => (
                                             <option key={branch._id} value={branch._id}>
                                                 {branch.branch_name}
                                             </option>
                                             ))}
                                 </select>
                                 {(branchErr)?(<div className="invalid-feedback d-block">Please Select Branch</div>):''}
                             </Form.Group>
                             </Col>
                             </>
                            )}
                    </Row>

                    <div className="text-md-end mb-0">
                        <Button variant="primary" className="me-1" type="submit">
                            Save
                        </Button>
                        <Button variant="secondary" type="button" onClick={() => reset()}>
                            Reset
                        </Button>
                    </div>
                </form>
            </Card.Body>
        </Card>
    );
};

